import React from 'react';

function LoginPage() {
  return (
    <div style={styles.container}>
      <h2>Login Page</h2>
      {/* You can add your login form here */}
    </div>
  );
}

const styles = {
  container: {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    justifyContent: 'center',
    height: '100vh',
    backgroundColor: '#f0f0f0',
  },
};

export default LoginPage;
